// Import necessary dependencies
import React from "react";
import {
  Container,
  Row,
  Col,
  Navbar,
  Nav,
  FormControl,
  Button,
} from "react-bootstrap";
import "./App.css";

// Create a functional component for the header section
const Header = () => {
  return (
    <header>
      {/* Video and Image */}
      <div className="header-video">
        {/* Use CSS to set the background video and image */}
        <video autoPlay loop muted>
          <source
            src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/04/maison-mirabeau-header-2023.mp4"
            type="video/mp4"
          />
        </video>
        <img
          src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/09/b-corp-logo-en.svg"
          alt="Logo"
          className="header-image"
        />
      </div>

      {/* Navigation Bar */}
      <Navbar expand="lg" className="navbar">
        {/* Logo */}
        <Navbar.Brand href="https://s3.amazonaws.com/shecodesio-production/uploads/files/000/126/912/original/mirabeau-logo.png?1716116679"></Navbar.Brand>

        {/* Mobile Navigation */}
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          {/* Navigation Links */}
          <Nav className="mr-auto">
            <Nav.Link href="#">Link 1</Nav.Link>
            <Nav.Link href="#">Link 2</Nav.Link>
            <Nav.Link href="#">Link 3</Nav.Link>
            <Nav.Link href="#">Link 4</Nav.Link>
            <Nav.Link href="#">Link 5</Nav.Link>
          </Nav>

          {/* Search Bar */}
          <FormControl type="text" placeholder="Search" className="mr-sm-2" />

          {/* Additional Links */}
          <Nav>
            <Nav.Link href="#">Link 6</Nav.Link>
            <Nav.Link href="#">Link 7</Nav.Link>
            <Nav.Link href="#">Link 8</Nav.Link>
            <Nav.Link href="#">Link 9</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </header>
  );
};

export default Header;
